import React from "react";

function TodoForm() {
    return (
        <form>
            <label>Write new To-Do</label>
            <textarea 
                placeholder="Something"
            />
            <button
                className="TodoForm-button--cancel"
            >Cancelar</button>
            <button
                className="TodoForm-button--add"
            >Add</button>
        </form>
    )
}
export { TodoForm };
